func HasDeviceWith(preds ...predicate.Device) predicate.FrpcInfo {
	return predicate.FrpcInfo(func(s *sql.Selector) {
		step := newDeviceStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.FrpcInfo) predicate.FrpcInfo {
	return predicate.FrpcInfo(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.FrpcInfo) predicate.FrpcInfo {
	return predicate.FrpcInfo(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.FrpcInfo) predicate.FrpcInfo {
	return predicate.FrpcInfo(sql.NotPredicates(p))
}
